import React from 'react';
import { useNavigate } from 'react-router-dom';
const Contact = () => {
  return (
    <>
      <h1>My Contact Pge</h1>
      <button onClick={goToContact}>Go to Contact Page</button>
    </>
  );
};

export default Contact;
